import React from "react";
import hiring from "../icons/Group 1103.png";

export default function Profile() {
    return (
      <div>
        <div className="profilepage">
          <div
            style={{
              backgroundColor: "#02979d",
              paddingTop: "25%",
              textAlign: "center"
            }}
          >
            <img
              src={hiring}
              style={{
                width: "90px",
                height: "90px",
                borderRadius: "50px",
                marginBottom: "5px",
              }}
            />
            <span
              style={{ color: "rgba(255, 255, 255, 1)", maxWidth: "100px" }}
            >
              <div className="welcomeBack">Welcome Backklmknk,lnkn;,;mlml!</div>
              <div className="profileName">Sarah Smith</div>
            </span>
          </div>
          <div>Hello</div>
          <div>knjnm</div>
        </div>
      </div>
    );
}
